import React from 'react';
import './App.css';
import TodoList from './component/TodoList';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Redux Todo List</h1>
            </header>
            <TodoList />
        </div>
    );
}

export default App;
